import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import webSocketService from '../../utils/websocket';

const Dashboard = () => {
  const [user, setUser] = useState(null);
  const [patientInfo, setPatientInfo] = useState(null);
  const [locationData, setLocationData] = useState(null);
  const [isConnected, setIsConnected] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    // Get user info from localStorage
    const userInfo = JSON.parse(localStorage.getItem('userInfo'));
    const token = localStorage.getItem('userToken');

    if (!userInfo || !token) {
      navigate('/login');
      return;
    }

    setUser(userInfo);

    // Connect to WebSocket
    webSocketService.connect(token);

    // Add WebSocket listeners
    webSocketService.addListener('connected', () => {
      setIsConnected(true);
    });

    webSocketService.addListener('disconnected', () => {
      setIsConnected(false);
    });

    webSocketService.addListener('message', (data) => {
      if (data.type === 'location') {
        setLocationData(data);
      }
    });

    // Fetch patient info if user is a caregiver
    if (userInfo.role === 'doctor' || userInfo.role === 'guardian') {
      fetchPatientInfo(token);
    }

    // Cleanup
    return () => {
      webSocketService.disconnect();
    };
  }, [navigate]);

  const fetchPatientInfo = async (token) => {
    try {
      const res = await axios.get('http://localhost:5000/api/patient-info', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setPatientInfo(res.data);
    } catch (err) {
      console.error('Error fetching patient info:', err);
    }
  };

  const sendLocationUpdate = () => {
    // Mock location data (in a real app, use geolocation API)
    const latitude = Math.random() * 90;
    const longitude = Math.random() * 180;

    webSocketService.sendLocation(latitude, longitude);
  };

  const logout = () => {
    localStorage.removeItem('userToken');
    localStorage.removeItem('userInfo');
    webSocketService.disconnect();
    navigate('/login');
  };

  if (!user) {
    return <div>Loading...</div>;
  }

  return (
    <div className="dashboard-container">
      <h2>Dashboard</h2>
      <div className="user-info">
        <h3>Welcome, {user.name}</h3>
        <p>Role: {user.role}</p>
        <p>WebSocket: {isConnected ? 'Connected' : 'Disconnected'}</p>

        {user.role === 'patient' && user.patientKey && (
          <div className="patient-key">
            <p>Your Patient Key: <strong>{user.patientKey}</strong></p>
            <p>Share this key with your doctors and guardians</p>
          </div>
        )}

        {(user.role === 'doctor' || user.role === 'guardian') && patientInfo && (
          <div className="patient-info">
            <h4>Linked Patient:</h4>
            <p>Name: {patientInfo.name}</p>
            <p>Email: {patientInfo.email}</p>
          </div>
        )}

        {user.role === 'patient' && (
          <div className="location-controls">
            <button onClick={sendLocationUpdate}>Send Location Update</button>
          </div>
        )}

        {(user.role === 'doctor' || user.role === 'guardian') && locationData && (
          <div className="location-data">
            <h4>Patient Location:</h4>
            <p>Patient: {locationData.patientName}</p>
            <p>Latitude: {locationData.latitude.toFixed(6)}</p>
            <p>Longitude: {locationData.longitude.toFixed(6)}</p>
            <p>Time: {new Date(locationData.timestamp).toLocaleString()}</p>
          </div>
        )}

        <button onClick={logout} className="btn btn-danger">Logout</button>
      </div>
    </div>
  );
};

export default Dashboard;
